import React from "react";

const Projects = () => {
    const projects = [
      {
        title: "Project 1",
        description: "A brief description of Project 1.",
        githubLink: "https://github.com/yourusername/project1",
        liveDemo: "https://project1-live-demo.com",
      },
      {
        title: "Project 2",
        description: "A brief description of Project 2.",
        githubLink: "https://github.com/yourusername/project2",
        liveDemo: "https://project2-live-demo.com",
      },
    ];

    return (
      <section id="projects" className="py-20 bg-gradient-to-r from-blue-50 to-purple-50">
        <h2 className="text-4xl font-bold text-center mb-10" data-aos="zoom-in">
          Projects
        </h2>
        <div className="container mx-auto px-4">
          {projects.map((project, index) => (
            <div
              key={index}
              className="mb-8 p-6 bg-gray-700 rounded-lg"
              data-aos="fade-up"
              data-aos-delay={index * 200}
            >
              <h3 className="text-2xl font-semibold">{project.title}</h3>
              <p className="mt-2">{project.description}</p>
              <div className="mt-4">
                <a
                  href={project.githubLink}
                  className="mr-4 text-blue-400 hover:text-blue-300"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  GitHub
                </a>
                <a
                  href={project.liveDemo}
                  className="text-blue-400 hover:text-blue-300"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Live Demo
                </a>
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  };

export default Projects;
